    Paypal_payment_not_completed_explained: "Possible reasons of not completed PayPal payment:<br><b>echeck</b>: The payment is pending because it was made by an eCheck that has not yet cleared.<br><b>intl</b>: The payment is pending because seller holds a non-U.S. account and do not have a withdrawal mechanism. Seller must manually accept or deny this payment.<br><b>multi-currency</b>: Seller do not have a balance in the currency sent. Seller must manually accept or deny this payment.<br><b>unilateral</b>: The payment is pending because it was made to an email address that is not yet registered or confirmed.<br><b>upgrade</b>: The payment is pending because it was made via credit card and seller must upgrade his account to Business or Premier status in order to receive the funds. <br><b>verify</b>: The payment is pending because seller is not yet verified. Seller must verify his account before he can accept this payment.<br><b>other</b>: The payment is pending for a reason other than those listed above. For more information, contact PayPal Customer Service.<br><b>Denied</b>: Seller refused to accept this payment.<br><b>Waiting for confirmation</b>: the owner of the user who made the payment should confirm it as valid in order to complete it."
